import './Nav.css';
import REturnLogo from './Logo';
import { IoIosWallet } from 'react-icons/io';

// View Nav
export default function REturnNavigaTion() {
 return (
  <div className='wrp-nav-homed'>
   <ul>
    <REturnLogo />
    <li>Product</li>
    <li>Get started</li>
    <li>For Business</li>
    <li>Support</li>
    <li><IoIosWallet size={'1.3rem'} color={'rgb(221, 197, 14)'} /></li>
   </ul>
  </div>
 );
};
